<script>
import { TimelineLite, TimelineMax } from 'gsap' 

export default {
    props: ['list', 'info'],
    name: 'SVGComponent',
    data() {
        return {
            max: null,
        }
    },
    mounted() {
        this.hideAllContentView()
        let { svgAnimation } = this.$refs
        this.max = new TimelineMax()
        this.max.to(svgAnimation, 2, {
            opacity: 1,
            ease: Back.easeOut
        }, 1)
        this.max.to('.circle-nav', 1, {
            opacity: 1,
            ease: Back.easeOut
        }, '-=.8')
    },
    methods: {
        btnServiceClick: function(event) {
            this.changeState()
            this.max.to('#circle-inner', .5, {
                rotation: 185,
                transformOrigin: 'center',
                svg: true
            })
            this.showEle(this.list.services.id)
        },
        btnProductClick: function(event) {
            this.changeState()
            this.max.to('#circle-inner', .5, {
                rotation: 264,
                transformOrigin: 'center',
                svg: true
            })
            this.showEle(this.list.product.id)
            
        },
        btnOverviewClick() {
            this.changeState()
            this.max.to('#circle-inner', .5, {
                rotation: 132,
                transformOrigin: 'center',
                svg: true
            })
            this.showEle(this.list.overview.id)
        },
        btnToolClick() {
            this.changeState()
            this.max.to('#circle-inner', .5, {
                rotation: 80,
                transformOrigin: 'center',
                svg: true
            })
            this.showEle(this.list.tools.id)
        },
        changeState() {
            document.querySelector('#circle-inner-inner').style.display = 'block'
            document.querySelector('#first').style.display = 'none'
            document.querySelector('#circle-inner').style.display = 'block'
            let act = document.querySelector('.circle-nav.actived')
            if (act != null)
                act.setAttribute('class', 'circle-nav')
            this.hideAllContentView()
        },
        hideAllContentView() {
            let allContent = document.querySelectorAll('.content-view')
            allContent.forEach(e => {
                e.style.display = 'none'
            })
        },
        showEle: function(id) {
            this.max.set('g#' + id + '> g:first-child > g', {
                scale: 0,
                onComplete: () => {
                    this.max.set('g#' + id + '> g:last-child', {
                        scale: 0
                    })
                    document.querySelector('g#' + id).style.display = 'block'
                    let ele = document.querySelectorAll('g#' + id + '> g:first-child > g')
                    let ic = document.querySelector('g#' + id + '> g:last-child')
                    this.loopScale(ele, 0, ic)
                }
            })
            document.querySelector('#btn-' + id).setAttribute('class', 'circle-nav actived')
        },
        loopScale: function(ele, i = 0, icon) {
            this.max.to(ele[i], .2, {
                scale: 1,
                ease: Back.easeOut,
                onComplete: () => {
                    i++
                    if (i < ele.length)
                        this.loopScale(ele, i, icon)
                    else {
                        this.max.to(icon, .2, {
                            scale: 1,
                            ease: Back.easeOut
                        })
                    }
                }
            })
        }
    }
}
</script>


<style>
    svg#svg-homepage {
        position: absolute;
        width: 100%;
        height: 100%;
        top: 0;
        left: 0;
        bottom: 0;
        right: 0;
        opacity: 0;
    }
    svg#svg-homepage:not(:root) {
        overflow: hidden;
    }
    .circle-nav {
        cursor: pointer;
        opacity: 0;
    }
    .circle-nav circle {
        fill: #584d4d;
        transition: fill .3s;
    }
    
    .circle-nav:hover circle {
        fill: #eb1b2e;
    }
    .circle-nav.actived {
        pointer-events: none;

    }
    .circle-nav.actived > circle {
        fill: #eb1b2e;
    }
    @media screen and (min-width: 320px) {
        svg#svg-homepage {
            -ms-transform-origin: center center;
            transform-origin: center center;
            -ms-transform: scale(1.8);
            transform: scale(1.8);
        }
    }
    @media (min-width: 568px) {
        svg#svg-homepage {
            -ms-transform-origin: center center;
            transform-origin: center center;
            -ms-transform: scale(1);
            transform: scale(1);
        }
    }
</style>
